{
  "name": "@sscfaith/avue-form-design",
  "author": {
    "name": "SSC",
    "url": "https://github.com/sscfaith",
    "email": "273702440@qq.com"
  },
  "version": "1.5.6",
  "main": "lib/index.umd.min.js",
  "scripts": {
    "serve": "vue-cli-service serve",
    "build": "vue-cli-service build",
    "lint": "vue-cli-service lint",
    "lib": "vue-cli-service build --target lib --name AvueFormDesign --dest lib --filename index --formats umd-min ./packages/index.js",
    "changelog": "conventional-changelog -p angular -i CHANGELOG.md -s"
  },
  "dependencies": {
    "monaco-editor": "^0.30.1",
    "vuedraggable": "^2.24.3"
  },
  "devDependencies": {
    "@vue/cli-plugin-babel": "^4.5.15",
    "@vue/cli-plugin-eslint": "^4.5.15",
    "@vue/cli-service": "^4.5.15",
    "avue-plugin-ueditor": "^0.2.3",
    "babel-eslint": "^10.1.0",
    "core-js": "^3.17.2",
    "eslint": "^7.32.0",
    "eslint-plugin-vue": "^6.2.2",
    "sass": "^1.49.9",
    "sass-loader": "^7.3.1",
    "vue-template-compiler": "^2.6.14"
  },
  "files": [
    "lib"
  ],
  "repository": {
    "type": "github",
    "url": "https://github.com/sscfaith/avue-form-design"
  },
  "keywords": [
    "vue",
    "element-ui",
    "avue",
    "form",
    "design"
  ],
  "eslintConfig": {
    "root": true,
    "env": {
      "node": true
    },
    "extends": [
      "plugin:vue/essential",
      "eslint:recommended"
    ],
    "rules": {
      "no-console": "off",
      "no-debugger": "off",
      "no-control-regex": 0
    },
    "parserOptions": {
      "parser": "babel-eslint"
    }
  },
  "postcss": {
    "plugins": {
      "autoprefixer": {}
    }
  },
  "browserslist": [
    "> 1%",
    "last 2 versions"
  ],
  "license": "MIT"
}

const webpack = require('webpack')
const path = require('path')
function resolve(dir) {
  return path.join(__dirname, dir)
}

module.exports = {
  transpileDependencies: ['avue-plugin-ueditor'],

  productionSourceMap: false,

  configureWebpack: {
    output: {
      libraryExport: 'default'
    }
  },

  chainWebpack: (config) => {
    config.externals({
      'vue': 'Vue',
      'element-ui': 'ElementUI',
    })
    config.resolve.alias
      .set('@', resolve('packages'))
      .set('@components', resolve('packages/components'))
      .set('@utils', resolve('packages/utils'))
      .set('@mixins', resolve('packages/mixins'))

    const output = config.output.store.get('path')
    if (output.includes('lib')) config.plugin('optimize')
      .use(webpack.optimize.LimitChunkCountPlugin, [{
        maxChunks: 1
      }])
  },

  devServer: {
    open: true
  },

  css: {
    extract: false
  }
}
